var _util={
  Store:function(){  		
    this.data = new Array();
    
    _util.Store.prototype.add=function(index, value){
      for (var i=0;i<this.data.length;i++){
        if ( this.data[i].index == index ){
          this.data[i].value = value;
          return true;
        }
      }
      this.data.push({index:index, value:value});
      return true;
    }
    _util.Store.prototype.remove=function(index){
      var _tmp = new Array();
      for (var i=0;i<this.data.length;i++){
        if ( this.data[i].index != index ){
          _tmp.push(this.data[i]);
        }
      }
      this.data = _tmp;
      return true;
    }
    _util.Store.prototype.size=function(){
      if (this.data == null) return 0;
      return this.data.length;
    }
    _util.Store.prototype.get=function(index){
      if (this.data == null) return null;
      for (var i=0;i<this.data.length;i++){
        if ( this.data[i].index == index ){
          return this.data[i].value;
        }
      }
      return false;
    }
    
    _util.Store.prototype.serializeIndex=function(){
      var _inxlst='';
      for (var i=0;i<this.data.length;i++){
        _inxlst += this.data[i].index;
        if ( i != (this.data.length-1) ){
          _inxlst += ',';
        }
      }
      return _inxlst;
    }
  }
};




